import React, { Component } from "react";

class NavBar extends Component {
  state = {};
  render() {
    return (
      <div>
        <nav className="navbar fixed-bottom navbar-expand-lg navbar-light ">
          <a className="navbar-brand" href="#">
            Fixed bottom
          </a>
        </nav>
      </div>
    );
  }
}

export default NavBar;
